import { ToDoItem } from "./ToDoItem"


export function ToDoList({ toDos}) {
    return (
        <ul className="list">
      <h4>My To Do List</h4>
      {toDos.length === 0 && "No To Dos, yay!"}
      {toDos.map(toDo => {
        return (
          <ToDoItem id={toDo.id} completed={toDo}/>
        )
      })}
      </ul>
    )
}
